import CreditCard from "./CreditCard"

function App() {
  const cardInfo = {
    userName: 'Max Mustermann',
    expirationData: '08/19',
    creditCardNum: '1234 5678 8965 4321',
    bankName: 'Comdirect'
  }
  return (
    <div className="App">
     <h1>My React App</h1>
     <CreditCard 
        cardInfo={cardInfo}
     />
    </div>
  );
}

export default App;
